import os
import subprocess
import sys
import base64
from watchdog.observers import Observer
from watchdog.events import FileSystemEventHandler
from pathlib import Path

# Base64-encoded icon file (replace '...' with your .ico file's base64 string)
ICON_BASE64 = b"""

"""

# Define default folder name and location
default_folder_name = "Automatic Setup Folder"
documents_path = Path.home() / "Documents"  # Path to 'Documents' directory
default_folder_path = documents_path / default_folder_name

# Function to save the embedded icon file
def save_icon_file(icon_path):
    if not icon_path.exists():
        with open(icon_path, "wb") as f:
            f.write(base64.b64decode(ICON_BASE64))
        print(f"Icon file saved at: {icon_path}")

# Function to ensure the folder exists
def ensure_setup_folder():
    if not default_folder_path.exists():
        print(f"Creating folder at: {default_folder_path}")
        default_folder_path.mkdir(parents=True, exist_ok=True)
    return default_folder_path

# Class to handle folder movement
class FolderEventHandler(FileSystemEventHandler):
    def __init__(self, folder_monitor):
        self.folder_monitor = folder_monitor

    def on_moved(self, event):
        if event.src_path == str(self.folder_monitor[0]):
            print(f"Folder moved to: {event.dest_path}")
            self.folder_monitor[0] = Path(event.dest_path)

# Start monitoring folder movement
def monitor_folder(folder_monitor):
    observer = Observer()
    handler = FolderEventHandler(folder_monitor)
    observer.schedule(handler, path=str(folder_monitor[0].parent), recursive=False)
    observer.start()
    return observer

# Main logic
if __name__ == "__main__":
    # Ensure the folder exists in the Documents directory
    folder_path = [ensure_setup_folder()]

    # Save the icon file to the folder
    icon_path = default_folder_path / "AutomaticSetup.ico"
    save_icon_file(icon_path)

    # Check if there are any setup files in the folder
    setup_files = [
        file for file in os.listdir(folder_path[0]) if file.endswith(('.exe', '.msi'))
    ]
    setup_files.sort()

    if not setup_files:  # If the folder is empty
        print(f"Folder is empty at: {folder_path[0]}")
        print("\nReturn when you have added the list of setup files to process.")
        input("Press [Enter] to exit the program.")
        sys.exit(0)

    # Start monitoring folder movement
    observer = monitor_folder(folder_path)

    try:
        while True:
            # Process each setup file
            for setup_file in setup_files:
                setup_path = folder_path[0] / setup_file
                try:
                    while True:
                        print(f"\nReady to run {setup_file}.")
                        print("\nOptions:")
                        print("[c] Continue")
                        print("[s] Skip")
                        print("[0] Exit")
                        user_input = input("\nEnter your choice: ").strip().lower()

                        if user_input in ['c', 'continue']:
                            print(f"\nRunning {setup_file}...")
                            subprocess.run(setup_path, shell=True)
                            print(f"\n{setup_file} has done.")
                            break
                        elif user_input in ['s', 'skip']:
                            print(f"\nSkipping {setup_file}...")
                            break
                        elif user_input == '0':
                            print("\nExiting program...")
                            import time
                            for i in range(3, 0, -1):
                                print(f"Closing in {i}...      ", end="\r")
                                time.sleep(1)
                            print("Closing now!            ", end="\r")
                            sys.exit(0)
                        else:
                            print("Invalid input. Please try again.")
                except Exception as e:
                    print(f"\nFailed to run {setup_file}: {e}")

            print("\nAll setup files have been processed.")
            input("Press [Enter] to exit the program.")
            break
    finally:
        observer.stop()
        observer.join()
